CREATE DEFINER=`root`@`localhost` PROCEDURE `dgn_GetChartData`(varUserID bigint unsigned,varStartTime datetime,varEndTime datetime )
BEGIN

select  extract(year_month from  indate) as yearmonth,   sum(b.Price*b.Quantity)  as amt
 from dgn_instorage_m a inner join dgn_instorage_s b on a.formid=b.formid
 group by  extract(year_month from  indate) ;
 
 select  extract(year_month from  outdate) as yearmonth, sum(b.Price*b.Quantity)  as amt
 from dgn_outstorage_m a inner join dgn_outstorage_s b on a.formid=b.formid
 group by  extract(year_month from  outdate) ;


END ;;
