CREATE DEFINER=`root`@`localhost` PROCEDURE `dgn_GetDynamicPageConfig`(varUserID bigint unsigned,varRouteUrl varchar(50),varDataID varchar(50) )
BEGIN
 declare varPageID bigint(20) unsigned;
  if varDataID!='' then
	select pageid into varPageID from dgn_page where  RouteUrl=varRouteUrl and pagetype=1 and isValid=1;
  else 
   select pageid into varPageID from dgn_page where  RouteUrl=varRouteUrl and pagetype=2 and isValid=1;
  end if;
  
  
  SELECT * FROM  dgn_page where pageid=varPageID and isValid=1;
  SELECT * FROM  dgn_pagecontrol where pageid=varPageID and isValid=1 order by  id;
  SELECT * FROM  dgn_pagebutton  where pageid=varPageID and isValid=1 order by `order` ;
  SELECT * FROM  dgn_pageAction  where pageid=varPageID and isValid=1 order by objectid,`order` ;
  SELECT * FROM  dgn_pageDataList where pageid=varPageID and isValid=1 order by `order` ; 
END ;;
