CREATE DEFINER=`root`@`localhost` PROCEDURE `dgn_GetFormLoadItems`(varUserID bigint unsigned,varRouteUrl varchar(50),varPageDataID varchar(50))
BEGIN

declare varI int;
declare varSqlStr nvarchar(4000);
declare varPageID bigint(20) unsigned;
  if varPageDataID!='' then
	select pageid into varPageID from dgn_page where  RouteUrl=varRouteUrl and pagetype=1 and isValid=1;
  else 
   select pageid into varPageID from dgn_page where  RouteUrl=varRouteUrl and pagetype=2 and isValid=1;
  end if;
set varI=0;
 while varI>=0  do
   select RelationSql into  @SqlStr  from dgn_pagecontrol 
     where PageID=varPageID and IsValid=1 and RelationSql!='' order by id  limit varI,1 ;
    if ROW_COUNT()<=0 then
		set varI=-1;
	else
        PREPARE psql FROM  @SqlStr;  
		EXECUTE psql ; 
        set varI=varI+1;
    end if;
 end while;
 
 
END ;;
